import React from 'react';
import Header from './components/Head'
import Bar from './components/Bar'
import Card from './components/Cards'
import LapData from './components/LapData'
import MobileData from './components/MobileData'
import ComputerData from './components/ComputerData'
import './style.css'
export default function App(){

const LapPack = LapData.map(lapItem =>{
        return<Card
        key={lapItem.id}
        {...lapItem}
        />
})
const MobilePack = MobileData.map(mobileItem =>{
    return<Card
    key={mobileItem.id}
    {...mobileItem}
    />

})
const ComputerPack = ComputerData.map(computerTtem =>{
    return<Card
    key={computerTtem.id}
    {...computerTtem}
    />

})


return(
    <div className='all-page'>
        <Header/>
        <Bar title='LapTops'/>
        <div className='lap-cont'> 
        {LapPack}
        </div>
        <Bar title='Mobile Phones'/>
        <div className='lap-cont'> 
        {MobilePack}
        </div>
        <Bar title='Computer Accessories'/>
        <div className='lap-cont'> 
        {ComputerPack}
        </div>
    </div>
)}
// LapTop
